import React, { Component } from 'react';

export class FetchData extends Component {
    static displayName = FetchData.name;

    constructor(props) {
        super(props);
        this.state = { forecasts: [], loading: true };
    }

    componentDidMount() {
        this.storesData();
    }

    static renderStores(stores) {
        return (
            <section className="row">
                {stores.map(store =>
                    <div class="col-12" key={store.name}>
                        <span class="image left special"><img class="" src={store.logo}></img></span>
                        <h3>{store.name}</h3>
                        <p>
                            Adipiscing dis a mus a convallis condimentum molestie penatibus iaculis  malesuada tempus vestibulum commodo habitasse suspendisse magnis.
						</p>
                    </div>                              
                       )
    }     
            </section>
        );
    }

render() {
    let contents = this.state.loading
        ? <p><em>Loading...</em></p>
        : FetchData.renderStores(this.state.forecasts);

    return (
        <section id="main">
            <header id="header">
                <div>Snapshot <span>by TEMPLATED</span></div>
            </header>
            <section id="contact">
                <div class="social column">
                   <h3>Stores</h3>
                    {contents}
                </div>
                <div className="row">
                    <div className="bg-dark"></div>
                </div>

                <div class="column">
                    <h3>Get in Touch</h3>
                    <form action="#" method="post">
                        <div class="field half first">
                            <label for="name">Name</label>

                        </div>
                        <div class="field half">
                            <label for="email">Email</label>

                        </div>
                        <div class="field">
                            <label for="message">Message</label>
                            <textarea name="message" id="message" rows="6" placeholder="Message"></textarea>
                        </div>
                        <ul class="actions">
                            <li></li>
                        </ul>
                    </form>
                </div>

            </section>
        </section>
    );
}

async storesData() {
    const response = await fetch('api/store');
    const data = await response.json();
    this.setState({ forecasts: data, loading: false });
}
}
